import React from 'react';
import ListSubheader from '@material-ui/core/ListSubheader';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import DoubleArrowIcon from '@material-ui/icons/DoubleArrow';
import Collapse from '@material-ui/core/Collapse';
import ExpandLess from '@material-ui/icons/ExpandLess';
import ExpandMore from '@material-ui/icons/ExpandMore';
import StarBorder from '@material-ui/icons/StarBorder';
import { PinDropSharp } from '@material-ui/icons';

class MusicLibrary extends React.Component {
  constructor(props){
    super(props);
    console.log(props.playLists);
  }
   render(){ 
     return (
     <MusicPlayerView playLists = {this.props.playLists}>
     </MusicPlayerView>
     )
   }
}


function MusicPlayerView(props) {
  console.log(props.playLists);
  const [open, setOpen] = React.useState(true);

  const handleClick = () => {
    setOpen(!open);
  };

  const playLists = props.playLists.map((index, playlist) => {
    return (
      <li key = {playlist}>
        <ListItem button>
        <ListItemIcon>
          <DoubleArrowIcon />
        </ListItemIcon>
        <ListItemText primary= {props.playLists[i]} />
      </ListItem>
      </li>
    )
  });

  return (
    <List
      component="nav"
      aria-labelledby="nested-list-subheader"
      subheader={
        <ListSubheader component="div" id="nested-list-subheader">
          Nested List Items
        </ListSubheader>
      }
    > 
      <ListItem button>
        <ListItemIcon>
          <DoubleArrowIcon />
        </ListItemIcon>
        <ListItemText primary= {props.playLists[0]} />
        {open ? <ExpandLess /> : <ExpandMore />}
      </ListItem>
      <ListItem button>
        <ListItemIcon>
          <DoubleArrowIcon />
        </ListItemIcon>
        <ListItemText primary="Playlist 2" />
        {open ? <ExpandLess /> : <ExpandMore />}
      </ListItem>
      <ListItem button onClick={handleClick}>
        <ListItemIcon>
          <DoubleArrowIcon />
        </ListItemIcon>
        <ListItemText primary="Playlist 3" />
        {open ? <ExpandLess /> : <ExpandMore />}
      </ListItem>
      <Collapse in={open} timeout="auto" unmountOnExit>
        <List component="div" disablePadding>
          <ListItem button>
            <ListItemIcon>
              <StarBorder />
            </ListItemIcon>
            <ListItemText primary="Starred" />
          </ListItem>
        </List>
      </Collapse>
    </List>
  );
}

export default MusicLibrary
